import React, { useEffect, useState } from 'react';
import api from '../api';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

export default function StudentDashboard() {
  const email = localStorage.getItem('email') || '';
  const [student, setStudent] = useState(null);
  const [resources, setResources] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const run = async () => {
      setError('');
      setLoading(true);
      try {
        if (!email) return setError('No email in localStorage. Please login.');
        const s = await api.get(`/api/students/${encodeURIComponent(email)}`);
        setStudent(s.data.data);
        const r = await api.get(`/api/mentors/resourcesForStudent`, { params: { studentEmail: email } });
        setResources(r.data.data || []);
      } catch (err) {
        setError(err?.response?.data?.message || 'Failed to load');
      } finally {
        setLoading(false);
      }
    };
    run();
  }, [email]);

  return (
    <motion.div initial={{ x: 24, opacity: 0 }} animate={{ x: 0, opacity: 1 }} transition={{ duration: 0.4 }}>
      <h3 style={{ marginTop: 0 }}>Student Dashboard</h3>
      <div className="dashboard-layout">
        <aside className="glass-card sidebar">
          <Link className="side-link" to="/student"><span className="icon">üè†</span>Home</Link>
          <Link className="side-link" to="/student"><span className="icon">üìö</span>Resources</Link>
          <Link className="side-link" to="/profile"><span className="icon">üë§</span>Profile</Link>
        </aside>
        <section>
          {error && <p className="error">{error}</p>}
          {loading ? (
            <div className="glass-card"><div className="spinner" /></div>
          ) : !student ? (
            <div className="glass-card"><p>No data</p></div>
          ) : (
            <div className="glass-card">
              <h4 style={{ marginTop: 0 }}>{student.name}</h4>
              <p>Email: {student.email}</p>
              <p>USN: {student.usn}</p>
              <p>CGPA: {student.cgpa}</p>
              <p>Attendance: {student.attendance}%</p>
              <p>Mentor: {student.mentorEmail || '‚Äî'}</p>
              <p>Class Teacher: {student.classTeacherEmail || '‚Äî'}</p>
            </div>
          )}

          <div className="glass-card" style={{ marginTop: 12 }}>
            <h4 style={{ marginTop: 0 }}>Mentor Resources</h4>
            {resources.length === 0 ? (
              <p>No resources yet</p>
            ) : (
              <ul className="list">
                {resources.map((r, idx) => (
                  <li key={idx} className="list-item">
                    <span>{r}</span>
                  </li>
                ))}
              </ul>
            )}
          </div>
        </section>
      </div>
    </motion.div>
  );
}
